import { createNativeStackNavigator } from "@react-navigation/native-stack"
import { NavigationContainer } from "@react-navigation/native";
import { Login } from "../view/Login";
import { Home } from "../view/Home";
import { Register } from "../view/Register"; 
import { Search } from "../view/Search" ;


const Stack = createNativeStackNavigator();

export const Router = () => {
    return(
        <NavigationContainer> 
           <Stack.Navigator>
            <Stack.Screen
             name='Login'
             component={Login}
             options={{
                headerShown: false,
             }}
            />
             <Stack.Screen
             name='Register'
             component={Register}
             options={{
                headerShown: false,
             }}
            />
            <Stack.Screen
             name='Home'
             component={Home}
             options={{
                headerShown: false,
             }}
            />
           <Stack.Screen
            name='Search'
            component={Search}
            options={{
                headerShown: false,
             }}
           />
           
            </Stack.Navigator>
        </NavigationContainer>
    );
};
